import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on a category to reveal the view toggle buttons
    // The view controls only appear on a search or category page.
    const electronicsCategoryCard = page.locator('div.category-card:has-text("Electronics")');
    await electronicsCategoryCard.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsCategoryCard.click();

    // Wait for the sort/filter controls to be visible
    await page.waitForSelector('.sort-filter-controls', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // 2. Locate and click the "List View" button
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.waitFor({ state: 'visible', timeout: 5000 });
    await listViewButton.click();

    // 3. Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // 4. Extract data to verify the view has changed
    const productContainer = await page.locator('.products-list');
    const containerClassName = await productContainer.getAttribute('class');

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        viewMode: containerClassName.includes('products-list') ? 'List View' : 'Grid View',
        finalClassName: containerClassName
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
